import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontList } from "./fontList";
import {FontPreviewProps} from "./fontPreviewProps";

export const UnknwonFont: React.FC<FontPreviewProps> = ({ previewText , fontSize, lineheight }) => {

    const fonts = [
        "CherryUnicode",
            "Kamjing",
            "MyanmarBlack",
            "MyanmarHeadOne",
            "MyanmarSquare",
            "MyanmarSquareLight",
            "NKSSmart2",
            "NKSSmart3",
            "Yangon",
            "YoeYar-One",
            "MyanmarAngoun",
            "MyanmarSabae",
            "MyanmarSansPro"
    ];

    return (
        <FontList title="Unknown Author Font Preview" previewText={previewText} fontSize={fontSize} data={fonts} lineheight={lineheight} />
    );
};
